import React from "react";
//@ts-ignore
import table1 from "./assets/documents/article_tables/table1.png";
//@ts-ignore
import table2 from "./assets/documents/article_tables/table2.png";
// @ts-ignore
import "./css/root.css";
import pdf from "./assets/documents/Article.pdf"

export default function Article(){
    return (<>
        <div>
            <h1>
                Urban forest effects on the accumulation of CO2 
                in the atmosphere and vice versa: A review
            </h1>
        </div>
        <embed src={pdf} type="application/pdf" width="100%" height="700px" scrollbar="1"/>
    </>);
}
